import Header from './Header';
import Head from 'next/head';
import Meta from './others/meta';


const Layout = ({sortList, children, headInfo}) => {
    return (
        <div>
            <Meta headInfo={headInfo}/>
            <Header sortList={sortList}/>
            {children}
        </div>
    )
}

export default Layout
